import React from 'react';
import './card.css';
import App from './app.app';


function cardTemp() {
    let title = "Card Title";
    let content = "Card Content";

    return (
      <div class="Card">
          <h3>{title}</h3>
          <p>{content}</p>
      </div>
    );
  }

  export default App;
